import React, { Component } from 'react';

class RightCockpit extends Component {
  state = {
    //rightCockpitDisplay: ()
  };
  render() {
    let displayOptions = (
      <div>
        <div className="btn-group btn-group-toggle" data-toggle="buttons">
          <label className="btn btn-danger m-1 active">
            <button
              type="radio"
              name="options"
              id="option1"
              autoComplete="off"
              onClick={event => this.contentViewHandler(event)}
              value="0"
            />{' '}
            Cockpit
          </label>

          <label className="btn btn-primary m-1 active">
            <button
              type="radio"
              name="options"
              id="option1"
              autoComplete="off"
              onClick={event => this.contentViewHandler(event)}
              value="1"
            />{' '}
            All Tasks
          </label>

          <label className="btn btn-success m-1 active ">
            <button
              type="radio"
              name="options"
              id="option2"
              autoComplete="off"
              onClick={event => this.contentViewHandler(event)}
              value="2"
            />{' '}
            Todays Tasks
          </label>

          <label className="btn btn-warning m-1 ">
            <button
              type="radio"
              name="options"
              id="option3"
              autoComplete="off"
              onClick={event => this.contentViewHandler(event)}
              value="3"
            />{' '}
            React Syllabus
          </label>
        </div>
      </div>
    );
    return <React.Fragment>{displayOptions}</React.Fragment>;
  }
}
export default RightCockpit;
